import React from 'react';
import './About.css';

const About = () => {
  return (
    <section id="about" className="about-section">
      <h1>About Me</h1>
      <div className="about-content">
        <div className="about-image">
          <img src="./about_images.JPG" alt="personal photo" />
        </div>
        <div className="about-text">
          <p>
            Hello! I'm [Your Name], a passionate developer with experience in
            [Your Skills Here]. I love to work on [Type of Projects You Like]
            and am constantly looking for opportunities to learn and grow.
          </p>
          <p>
            I graduated from [Your School or Educational Background Here] and
            have been in the field for [Years of Experience].
          </p>
          <p>
            When not coding, you can find me [Your Hobbies or Interests].
          </p>
        </div>
      </div>
    </section>
  );
};

export default About;
